import "./style.css";

function About(){
    return(
        <section className="aboutUs">
            <div className="aboutUs_container">
                <div className="left">
                    <p>ABOUT OUR COMPANY</p>
                    <p></p>
                    <h2></h2>
                </div>
            </div>
        </section>
    )
}

export default About;
